import React from "react";
import { Route, Routes, Link } from "react-router-dom";
import Login from "../pages/auth/Login";
import Register from "../pages/auth/Register";
import Dashboard from "../pages/dashboard";
import "../styles/global.css";

const App = () => {
  return (
    <Layout>
      <div>
        <p>App</p>
      </div>
    </Layout>
  );
};

const Home = () => {
  return (
    <Layout>
      <div>
        <p>Home</p>
      </div>
    </Layout>
  );
};

const About = () => {
  return (
    <Layout>
      <div>
        <p>About</p>
      </div>
    </Layout>
  );
};

const Contact = () => {
  return (
    <Route path="/contact" element={<ListData />}>
      <Route path="/contact/create" element={<CreateData />} />
      <Route path="/contact/update" element={<UpdateData />} />
      <Route index element={<ListData />} />
    </Route>
  );
};

const ListData = () => {
  return (
    <nav>
      <Link to="/contact/create">Create</Link> |{" "}
      <Link to="/contact/update">Update</Link>
    </nav>
  );
};

const CreateData = () => {
  return (
    <div>
      <p>New Data</p>
    </div>
  );
};

const UpdateData = () => {
  return (
    <div>
      <p>Update Data</p>
    </div>
  );
};

const Header = () => {
  return (
    <div>
      <p>Header</p>
    </div>
  );
};

const Sidebar = () => {
  return (
    <nav>
      <Link to="/">App</Link> | <Link to="/home">Home</Link> |
      <Link to="/about">About</Link> |<Link to="/contact">Contact</Link>
    </nav>
  );
};

const Footer = () => {
  return (
    <div>
      <p>Footer</p>
    </div>
  );
};

const Layout = ({ children }) => {
  // auth if user not login return to login page
  return (
    <div>
      <Header />
      <Sidebar />
      {/* bisa pake outlet buat ganti children */}
      <div>{children}</div>
      <Footer />
    </div>
  );
};

// const Content = ({ children }) => {
//   return <div className="mt-2">{children}</div>;
// };

const Router = () => {
  return (
    <Routes>
      <Route exact path="/" element={<App />} />
      <Route exact path="/home" element={<Home />} />
      <Route exact path="/about" element={<About />} />
      <Route exact path="/contact" element={<Contact />} />

      <Route path="*" element={<h1>Not found page</h1>} />
    </Routes>
  );
};

export default Router;
